import React, { Component, Fragment } from "react";

export default function Counter() {
  const state = {
    count: 1,
    tags : ['tag1','tag2','tag3','tags']
    // imageUrl: "../agriculture-economy.png"
  };
  const styles = {
    color: "red",
    width:"10em",
    backgroundColor:"white",
    marginLeft : "0.1em"
  };
  const btn = {
    color: "white",
    height: "2.5em",
    width: "3.5em",
    backgroundColor: "red"
  };
  const btn1 = {
    color: "white",
    height: "2.5em",
    width: "7em",
    backgroundColor: "blue"
  };
  const btn2 = {
    color: "white",
    height: "2.5em",
    width: "3.5em",
    backgroundColor: "green"
  };
  const btn3 = {
    color: "white",
    height: "2.5em",
    width: "3.5em",
    backgroundColor: "blue"
  };
  return (
    <Fragment>
      <h3>My Calculator</h3>
      <div style={styles}>{state.count}</div>
      <div>
      <button style={btn} onClick="alert(hey)">Zero</button>
      <button style={btn1}>Increment</button>
      </div>
      <div>
        <button style={btn2}>1</button>
        <button style={btn2}>2</button>
        <button style={btn2}>3</button>
      </div>
      <div>
        <button style={btn2}>4</button>
        <button style={btn2}>5</button>
        <button style={btn2}>6</button>
      </div>
      <div>
        <button style={btn2}>7</button>
        <button style={btn2}>8</button>
        <button style={btn2}>9</button>
      </div>
      <div>
        <button style={btn3}>+</button>
        <button style={btn3}>-</button>
        <button style={btn3}>/</button>
      </div>
      <div>
        <button style={btn3}>*</button>
        <button style={btn3}>%</button>
        <button style={btn}>=</button>
      </div>
      <ul>
        {state.tags.map(tag => <li key={tag}>{tag}</li>)}
      </ul>
      <ul>
        {state.tags.map(tag => <span key={tag}>{tag}</span>)}
      </ul>
    </Fragment>
  );
}

